import {
  Button,
  Grid,
  Table,
  TableBody,
  TableContainer,
  TableHead,
  TableRow,
  TextField,
} from "@mui/material";
import Form from "../components/Form";
import TableC from "../components/Table";
import SendIcon from "@mui/icons-material/Send";
import { TableCell } from "@mui/material";

const listInstitute = [
  { id: 1, name: "Valle Grande" },
  { id: 2, name: "Condoray" },
  { id: 3, name: "Telesup" },
];

export const Institute = () => {
  return (
    <>
      <Form title="Instituto">
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <TextField label="Instituto" />
          </Grid>
          <Grid item xs={12}>
            <Button variant="contained">
              <SendIcon />
              {"Enviar"}
            </Button>
          </Grid>
        </Grid>
      </Form>
      <TableC title="Lista de Instituto">
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Instituto</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {listInstitute.map((institute) => (
                <TableRow
                  key={institute.id}
                  sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                >
                  <TableCell component="th" scope="row">{institute.name}</TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </TableC>
    </>
  );
};

export default Institute;
